*/

import { useState, useEffect, useMemo } from "react";

// react-router components
import { Route, Switch, Redirect, useLocation } from "react-router-dom";

// @mui material components
import { ThemeProvider } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";
import Icon from "@mui/material/Icon";
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
import breakpoints from "assets/theme/base/breakpoints";

// Vision UI Dashboard PRO React components
import VuiBox from "components/VuiBox";
import VuiTypography from "components/VuiTypography";
import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";
import Footer from "examples/FooterXLH";
import Globe from "examples/Globe";

// Plugins custom css
import "assets/theme/base/plugins.css";
import "assets/custom.css";

// icons
import { FaShoppingCart } from "react-icons/fa";
import { BsGlobe } from "react-icons/bs";
import { IoWallet, IoDocumentText } from "react-icons/io5";

//Ciio custom components
import Main from "layouts/main";
import TeamProfileCard from "examples/Cards/TeamCards/TeamProfileCard2";
import StakingCard from "cards/StakingCard";
import EventCard from "cards/EventCard";



function Farms() {


  return (  
    <Main name="Staking">
      <Grid container>
        <Grid item xs={12} md={6} lg={4}>
          <EventCard            
            title="Farm 1"
            lockedTime="0 days locked"
            apr="2%"
            myXLH={3000}
            myRewards={300}
            stake={{
              size: "small",
              color: "success",
              label: "Stake",
              action: ""
            }}
            claim={{
              size: "small",
              color: "info",
              label: "Claim",
              action: ""
            }}
            reinvest={{
              size: "small",
              color: "error",
              label: "Reinvest",
              action: ""
            }}



            image="https://bit.ly/3DxwJVb"
            id="902-128-281"
            description="You have an upcoming meet for Marketing Planning"

            members={[
              { image: "https://bit.ly/3Hnpa5B", name: "Alexa Tompson" },
              { image: "https://bit.ly/3kFlORQ", name: "Martin Doe" },
              { image: "https://bit.ly/3DkuTGL", name: "Alexaner Smith" },
              { image: "https://bit.ly/3cfEZgu", name: "Romina Hadid" },
            ]}
          />
        </Grid>
      </Grid>






      <Grid item xs={12}>
        <StakingCard>

        </StakingCard>
      </Grid>



      <Grid item lg={12}>
        <VuiBox mb={3}>
          <TeamProfileCard
              title="Farm 0"
              description="You can claim the rewards anytime, no waiting time - small APR"
              total="100.000 XLH"
              apy="2%"
              amount={true}
              holders={12}
          />
        </VuiBox>                
      </Grid>    
      <Grid item lg={12}>
        <VuiBox mb={3}>
          <TeamProfileCard
              title="Farm 0"
              description="You can claim the rewards anytime, no waiting time - small APR"
              total="100.000 XLH"
              apy="2%"
              amount={true}
              holders={12}
          />
        </VuiBox>                
      </Grid> 
      <Grid item lg={12}>
        <VuiBox mb={3}>
          <TeamProfileCard
              title="Farm 2"
              description="You can claim the best rewards after a period of 120 days, longer waiting time - great APR"
              total="100.000 XLH"
              apy="10%"
              amount={true}
              holders={59}
          />
        </VuiBox>                
      </Grid>
    </Main> 
  );
}

export default Farms;
